Information
------------------------------

The Wild West
Before cowboys and before the Gold Rush, there were the original outlaws of the West - the truly untamed animals that call America home. Elephant seals settling their scores with blood; black and brown bears prospecting for pink gold in the form of thousands of salmon; and bobcats exploring the New World alone. Now, venture inside the coasts, deserts and mountains where these wild creatures roam.


1)  Gold Rush 
In an eat-or-be-eaten environment, see how the smallest mouse to the largest bobcat lives in a world where every day is unpredictable. Our cameras are front and center. We'll capture the famed upstream swim of the Alaskan salmon in brilliant detail. Then get inside the world of the creatures that call the redwood forest home. And, see how snakes, owls, bobcats and mice all battle for food, shelter and survival among the tallest trees on Earth. Who will take their post as &quot;king&quot; of their land?

2)  True Grit 
Only the strong survive in the Rocky Mountains. Meet the grey wolves, outlaws of the mountains, feared and respected by all who dwell there. Watch how a pack fights, hunts and keeps order. Like the wolves, grizzly bears strike fear into the hearts of all who live in their territory. Each year they teach the young guns how to survive rough-and-tumble mountains. And witness cowboys riding bucking broncos, using techniques passed down for generations. Its man vs. beast and these beasts fight back.

3)  High Noon 
Journey to the most inhospitable environments in the country -- the deserts of the West. The creatures that live here are some of the toughest in the land, including vultures, the undertakers of the desert, and hawks, who hunt and roam the desert like a biker gang. And get up-close access to possibly the most vicious desert-dweller of all, the scorpion, whose diet is made up of ... mostly other scorpions. Only the toughest of the tough can outwit their enemies and survive here.

